const styles = {
    error: 'background: red; color white;font-size: 12pt',
    warning: "background: yellow, color: black",
    info: '',
    debug: 'background: gray'
}

const useConsoleLog = () => {
    var _log = (message, style) => {
        console.log("%ctest", "background: yellow")
        console.log(`%c${message}`, style);
    }

    var error = (message) => {
        console.error("%c"+message, styles.error)
        _log(message, styles.error);
    }

    var warning = (message) => {
        console.warn(`%c {message}`, styles.warning)
        
        _log(message, styles.warning);
    }

    var info = (message) => {
        _log(message, styles.info);
    }

    var debug = (message) => {  
        _log(message, styles.debug);
    }

    return {
        error: error,
        warning: warning,
        info: info,
        debug: debug
    }
}

export default useConsoleLog;
